geminiQuery:
This is a parsed receipt. Give this receipt some tags that can be used to categorize it. This will be used in a search functionality such that receipts with different tags can be easily found. The available tags are: grocery, dining, retail, entertainment, technology, personal care, other. Return the receipt in the following format:
{
  "establishment": {
    "name": "Store Name"
  },
  "transaction": {
    "date": "YYYY-MM-DD"
  },
  "items": [
    {
      "name": "Item 1",
      "quantity": 1,
      "unit_price": 9.99,
      "total_price": 9.99
    },
    {
      "name": "Item 2",
      "quantity": 2,
      "unit_price": 5.49,
      "total_price": 10.98
    }
  ],
  "taxes": {
    "GST": 1.50,
    "PST": 1.00
  },
  "tip": 2.00,
  "total": 25.47
}

. Make sure your output is in the format:
{
"receipt":{...receiptObject...},
"categories": ["cat1", "cat2", "cat3"]
}

Make sure to include all the fields with their default zero values if they do not exist.
